import { CircularProgressBar } from "@tomickigrzegorz/react-circular-progress-bar";
import styled from "styled-components";


const Text = styled.p`
    position: absolute;
    top : 50%

`

function CicleProgress() {

    return (
        <>
            <CircularProgressBar
                colorCircle="#ededed"
                colorSlice="#e54e21"
                percent={80}
                fontColor="white"
                round={true}
                fontSize="15px"
                textPosition="1.5rem"
            >
            <Text>Server</Text>
            </CircularProgressBar>
        </>
    )

}

export default CicleProgress
